                </div>
                <h2 style=""text-align:center;""><b>Welcome to Python Course</b></h2>
                <hr />
                <h1 class=""font-weight-bold"">Python RegEx</h1>
                <p>A RegEx, or Regular Expression, is a sequence of characters that forms a search pattern.</p>
                <p>RegEx can be used to check if a string contains the specified search pattern.</p><br>

                <h1 class=""font-weight-bold"">RegEx Module</h1>
                <p>Python has a built-in package called re, which can be used to work with Regular Expressions.</p>
                <p>Import the re module:</p>
                <span class=""text-info"">import re</span><br>

                <h1 class=""font-weight-bold"">RegEx ModuleRegEx in Python</h1>
                <p>When you have imported the re module, you can start using regular expressions:</p><br>
                <span class=""text-info"">import re</span><br>
                <br>
                <span>txt = </span><span cl");
                WriteLiteral(@"ass=""text-danger"">""The Ran in Spain""</span><br>
                <span>x = re.search</span><span class=""text-danger"">""The.*Spain$""</span><span>, txt</span><br><br>

                <h1 class=""font-weight-bold"">RegEx Functions</h1><br>
                <p>The re module offers a set of functions that allows us to search a string for a match:</p>
                <table class=""table table-bordered table-striped"">
                    <tr>
                        <th>Function</th>
                        <th>Description</th>

                    </tr>
                    <tr>
                        <td>findall</td>
                        <td>Returns a list containing all matches</td>

                    </tr>
                    <tr>
                        <td>search</td>
                        <td>Returns a Match object if there is a match anywhere in the string</td>

                    </tr>
                    <tr>
                        <td>split</td>
                        <td>Retu");
                WriteLiteral(@"rns a list where the string has been split at each match</td>

                    </tr>
                    <tr>
                        <td>sub</td>
                        <td>Replaces one or many matches with a string</td>

                    </tr>

                </table>
                <br>
                <h1 class=""font-weight-bold"">Metacharacters</h1><br>
                <p>Metacharacters are characters with a special meaning:</p><br>
                <table class=""table table-bordered table-striped"">
                    <tr>
                        <th>Character</th>
                        <th>Description</th>
                        <th>Example</th>

                    </tr>
                    <tr>
                        <td>[]</td>
                        <td>A set of characters</td>
                        <td>""[a-m]""</td>

                    </tr>
                    <tr>
                        <td>\</td>
                        <td>Signals a special sequence ");
                WriteLiteral(@"(can also be used to escape special characters)</td>
                        <td>""\d""</td>
                        <td>x - y</td>
                    </tr>
                    <tr>
                        <td>.</td>
                        <td>Any character (except newline character)</td>
                        <td>""he..o""</td>

                    </tr>
                    <tr>
                        <td>^</td>
                        <td>Starts with</td>
                        <td>""^hello""</td>

                    </tr>
                    <tr>
                        <td>$</td>
                        <td>Ends with</td>
                        <td>""world$""</td>

                    </tr>
                    <tr>
                        <td>*</td>
                        <td>Zero or more occurrences</td>
                        <td>""aix*""</td>

                    </tr>
                    <tr>
                        <td>+</td>
                        <td>One or more occur");
                WriteLiteral(@"rences</td>
                        <td>""aix+""</td>


                    </tr>
                </table>
                <br>
                <h1 class=""font-weight-bold"">Special Sequences</h1><br>
